import React, { PropsWithChildren } from 'react';
import logo from './logo.svg';
import './App.css';

interface textProps {
  name : string
}

const App = ({name, children} : PropsWithChildren<textProps>) => {
  return (
    <div className="App">
     <h1> My name is {name} </h1>
     {children}
    </div>
  );
}

export default App;
